import React from "react";

class ScoreBoard extends React.Component {
    render() {
        return (
            <React.Fragment>
                <section className="container-fluid text-center my-5">
                    <div className="row">
                        <div className="col">
                            <h1>MARCADOR</h1>
                        </div>
                    </div>
                </section>
            </React.Fragment>
        )
    }
}

export default ScoreBoard;
